INSERT INTO `hakkimizda` (`id`, `baslik`, `aciklama`, `resim`) VALUES
(1, 'Altınay Savunma Teknolojileri', 'Altınay Savunma, ileri teknolojiler ve yenilikçi çözümler ile savunma sanayisine hizmet sunan lider bir Türk firmasıdır. Kuruluşumuzdan bu yana, milli güvenliğin sağlanması ve savunma kapasitemizin artırılması için üstün mühendislik yeteneklerimiz ve inovatif yaklaşımımız ile çalışmalarımızı sürdürmekteyiz.\r\n\r\nAltınay Savunma’nın kurucusu Hakan Altınay, Türk savunma sanayisine olan tutkusuyla tanınan vizyoner bir liderdir. Hakan Altınay, mühendislik ve teknoloji alanındaki geniş bilgi birikimi ve deneyimiyle firmamızın temelini atmış ve bugünlere gelmesini sağlamıştır. Onun liderliğinde, Altınay Savunma hem yerel hem de uluslararası alanda saygınlık kazanmıştır. Hakan Altınay, sürekli olarak yenilikçi çözümler geliştirme ve teknolojik üstünlük sağlama vizyonuyla hareket etmektedir.', );

