INSERT INTO `kartlar` (`id`, `baslik`, `özet`, `içerik`, `resim`, `tarih`) VALUES
(1, 'Türkiye’nin İlk Yerli Helikopter Yakalama ve Transfer Sistem', 'Developing innovative and national solutions in line with Türkiye’s goal of establishing a fully independent defence industry, STM Savunma Teknolojileri Mühendislik ve Ticaret A.Ş. has achieved another milestone in its indigenisation and nationalization efforts in the naval platform field.Developing innovative and national solutions in line with Türkiye’s goal of establishing a fully independent defence industry, STM Savunma Teknolojileri Mühendislik ve Ticaret A.Ş. has achieved another milestone in its indigenisation and nationalization efforts in the navallik ve ', 'Developing innovative and national solutions in line with Türkiye’s goal of establishing a fully independent defence industry, STM Savunma Teknolojileri Mühendislik ve Ticaret A.Ş. has achieved another milestone in its indigenisation and nationalization efforts in the naval platform field.', , NULL);
INSERT INTO `kartlar` (`id`, `baslik`, `özet`, `içerik`, `resim`, `tarih`) VALUES
(2, 'Türk Kızılay Lojistik, İHA’lardan Yararlanacak', 'Türk Kızılay Lojistik, İnsansız Hava Aracı (İHA) sistemleri ile özellikle kan başta olmak üzere kritik medikal malzeme taşımak üzere DASAL ile anlaşma imzaladı.', 'Türk Kızılay Lojistik, İnsansız Hava Aracı (İHA) sistemleri ile özellikle kan başta olmak üzere kritik medikal malzeme taşımak üzere DASAL ile anlaşma imzaladı. İş birliği protokolüne göre DASAL imalatı 15, 75 ve 150 kilogram taşıma kapasitesine sahip İHA sistemleri ile Kızılay kent içi taşıma gerçekleştirecek.', , NULL);
INSERT INTO `kartlar` (`id`, `baslik`, `özet`, `içerik`, `resim`, `tarih`) VALUES
(16, 'Altınay Savunma Teknolojileri G7 Aerospace ile Küresel Bir Adım Daha Attı', 'Malezya Merkezli G7 Aerospace ve Altınay Savunma Teknolojileri AŞ arasında “Teaming Agreement (Takım Anlaşması)” imzalandı. Anlaşmaya Altınay Savunma adına Genel Müdür Burak Mercan, G7 Aerospace adına firma yöneticisi Datuk Rosdi Mahmud imza koydu.', 'Malezya Merkezli G7 Aerospace ve Altınay Savunma Teknolojileri AŞ arasında “Teaming Agreement (Takım Anlaşması)” imzalandı.\r\n\r\nAnlaşmaya Altınay Savunma adına Genel Müdür Burak Mercan, G7 Aerospace adına firma yöneticisi Datuk Rosdi Mahmud imza koydu.\r\n\r\nAnlaşma kapsamında Altınay Savunma ile G7 Aerospace firması iş birliğiyle Malezya Savunma ve Güvenlik Teşkilatlarına İnsansız Hava Aracı (İHA) çözümleri, Entegre Lojistik Bakım Hizmetleri (ILMS) ve İHA Sistemleri Eğitimi hizmeti verilecek.\r\n\r\nAltınay Teknoloji Grubu bağlısı olan Altınay Savunma Teknolojileri, 2014 yılında Altınay Havacılık ve İleri Teknolojiler adıyla kuruldu.\r\n\r\nFirma, 2021 yılından itibaren “Altınay Savunma Teknolojileri” olarak faaliyetlerine devam ediyor.\r\n\r\n“Altınay Savunma Teknolojileri”, Altınay Teknoloji Grubu’nun 30 yıla yaklaşan mühendislik bilgisiyle birlikte son derece önemli çözümleri hayata geçiriyor.', , '2024-08-21');

