INSERT INTO `projeler` (`id`, `isim`, `detay`, `resim`, `tarih`, `resim2`, `resim3`, `detay2`, `detay3`) VALUES
(1, 'İNSANSIZ SİSTEMLER', 'İnsansız hava araçları kapsamında farklı faydalı yük taşıma ve görev icra etme yeteneklerine göre, mini sınıf, hafif sınıf, orta sınıf ve ağır sınıf hava platformları çözümleri sağlamaktadır. Bu çözümler kullanıcın ihtiyacına göre gündüz veya gece koşullarında; keşif, gözetleme, ateş gücü, beka ve lojistik idame yeteneklerine sahiptir.\r\n\r\nİnsansız kara araçları kapsamında çeşitli operasyonlarda kullanılabilir, hareket kabiliyeti yüksek, hafif, dayanıklı ve yüksek otonom seviyesinde kullanımı kolay ve taşınabilir ve atılabilir insansız kara araçı çözümleri sunuyoruz.\r\n\r\n\r\n\r\n', , '2024-08-06', , , 'Robot sistemleri kapsamında, patlayıcıları zorlu koşullar altında ve insan hayatını tehlikeye atmadan güvenli bir mesafeden etkisiz hale getiren yeni nesil bomba imha robot kolları ve otomotiv sektörü başta olmak üzere endüstriyel alanlarda insan sağlığına tehdit oluşturan özel operasyonlar için geliştirilmiş endüstriyel robot çözümleri sunuyoruz.\r\n', 'Altınay Savunma çeyrek asırlık tecrübesiyle, müşterilerinin insansız sistemler alanındaki ihtiyaçlarını eksiksiz bir şekilde karşılamak için yaptığı çalışmalarda son teknolojiyi kullanarak ürünlerini tasarlamakta ve geliştirmektedir.\r\n');
INSERT INTO `projeler` (`id`, `isim`, `detay`, `resim`, `tarih`, `resim2`, `resim3`, `detay2`, `detay3`) VALUES
(3, 'Kızılötesi İz Yönetim Sistemi', 'Altınay Savunma deniz sistemleri alanında, ülkemizin yurtdışı bağımlılığını ortadan kaldıran ve ihracat potansiyelini arttıran hareket kontrol sistemleri ve deniz savunma sistemlerinin yanı sıra büyük önem taşıyan görünmezlik sistemleri gibi çeşitli çözümler de sunmaktadır.\r\n\r\nMuharebe ortamında, bir platformun yaydığı kızılötesi iz, önemli bir belirleyicidir. Bu iz, kızılötesi güdümlü füzeler tarafından tespit edilerek hedef alınma riskini artırabilir. Bu riski azaltmak amacıyla Gerçek Zamanlı Kızılötesi İz Yönetim (GEZKİY) Sistemi geliştirilmiştir. Bu sistem, askeri gemi platformunun yaydığı kızılötesi izi anlık olarak izleyebilmektedir. Sistem, platformun çeşitli ışıma bölgelerine yerleştirilmiş sıcaklık algılayıcılarından gelen mutlak sıcaklık verileri ile Gemi Veri Dağıtım Sistemi (GVDS) aracılığıyla sağlanan hava sıcaklığı, rüzgar hızı, deniz suyu sıcaklığı gibi meteorolojik bilgileri kullanarak platforma özgü kızılötesi izi hesaplar. Bu hesaplama sonucunda, platformun o anki ışımasına bağlı olarak olası tehdit bölgeleri belirlenip, platform yetkililerine sunulmaktadır.', , '2024-08-06', NULL, NULL, NULL, NULL);
INSERT INTO `projeler` (`id`, `isim`, `detay`, `resim`, `tarih`, `resim2`, `resim3`, `detay2`, `detay3`) VALUES
(4, 'Orta Sınıf İnsansız Hava Araçları', 'Orta Sınıf İnsansız Hava Araçları, 15 kg faydalı yük kapasitesi ile kargo,mühimmat ve benzeri çeşitli faydalı yüklerin hedefe bırakılması/taşınması görevlerini başarıyla yerine getiren kargo iha sistemlerinin yanı sıra, 2-eksen stabilize hareket kabiliyetine sahip taret entegrasyonu ile, NATO standartlarına uygun olarak 5,56 mm kalibre piyade tüfeği, üstün geri tepme sönümleyici sistemi ve yüksek mermi taşıma kapasitesi ile gerektiği durumlarda etkili bir ateş gücü olabilmektedir.', , '2024-08-06', NULL, NULL, NULL, NULL);
INSERT INTO `projeler` (`id`, `isim`, `detay`, `resim`, `tarih`, `resim2`, `resim3`, `detay2`, `detay3`) VALUES
(5, 'Ağır Sınıf İnsansız Hava Araçları', 'Ağır Sınıf İnsansız Hava Araçları, uzun menzili, yüksek yatay hızı ile modüler yapısı ve 75 kg\'dan 150kg\'a kadar faydalı yük kapasitesi ile alanında öncü Döner Kanatlı Kargo İHA sistemleridir. Taktik sahada ihtiyaç duyulan destek malzemelerini özel tasarlanmış üniteleri ile otonom olarak hızlı, etkin ve sessiz bir şekilde hedef bölgeye ulaştırmaktadır. Taktik sahada, afet bölgelerinde ve sivil kullanımda lojistik ihtiyaçları karşılamak üzere tasarlanmıştır.', , '2024-08-07', NULL, NULL, NULL, NULL);
INSERT INTO `projeler` (`id`, `isim`, `detay`, `resim`, `tarih`, `resim2`, `resim3`, `detay2`, `detay3`) VALUES
(6, 'SALAN-4', 'Çoklu taşıma salanları tekli, ikili ve dörtlü kombinasyonlarda MIL-STD-8591 standartlarına uygun olarak 100lb\'den 1000lb\'ye kadar mühimmat taşıma kapasitesine sahiptir. Türkiye\'de ilk dünyada ikinci defa geliştirilen pnömatik dörtlü bomba salanı aynı anda 4 adet 250 libre akıllı bombayı taşıma ve fırlatma kabiliyetine sahiptir. Yüksek güvenilirlik, yüksek çıkış hızı, kullanım kolaylığı ve kısa sürede operasyona hazır hale gelme yetenekleri ile dünyada gün geçtikçe daha yaygın olarak kullanılmaktadır.', , '2024-08-06', NULL, NULL, NULL, NULL);
INSERT INTO `projeler` (`id`, `isim`, `detay`, `resim`, `tarih`, `resim2`, `resim3`, `detay2`, `detay3`) VALUES
(7, 'SALAN-R40', 'Farklı mühimmatlara uyumlu olan SALAN-R40 Döner Kanatlı Bombardıman İHA sistemlerinin çoklu adetlerde mühimmat taşıyarak farklı doktirinlerde görev alabilecek kabiliyete ulaşmasını sağlar. Entegre olduğu hava aracı SALAN-R40 sayesinde, taktik sahada hedefi hassas atış kabiliyetiyle imha ederek operasyonunu tamamlar.', , '2024-08-06', NULL, NULL, 'Silahlı kuvvetler için karadan karaya kullanılan mühimmatların havadan karaya kullanılmasını sağlayarak taktik sahada önemli kabiliyet kazandırır.', NULL);
INSERT INTO `projeler` (`id`, `isim`, `detay`, `resim`, `tarih`, `resim2`, `resim3`, `detay2`, `detay3`) VALUES
(8, 'Hafif Sınıf İnsansız Hava Araçları', 'Hafif Sınıf İnsansız Hava Araçları, uzun uçuş süresi, zorlu hava şartlarına dayanımı, modüler yapısı, kolay kurulumu ve tek personel tarafından rahatlıkla taşınması ile ön plana çıkan; keşif, gözetleme ve istihbarat platformu olarak kendini taktik sahada kanıtlamış Döner Kanatlı İHA sistemleridir.', , '2024-08-06', NULL, NULL, NULL, NULL);

