INSERT INTO `yonetimekibi` (`id`, `isim`, `soyisim`, `aciklama`, `resim`) VALUES
(1, 'Hakan', 'Altınay', '1990 yılında İstanbul Teknik Üniversitesi Uçak ve Uzay Bilimleri Fakültesi’nden Türkiye’nin ilk dört Uzay Mühendisinden  biri olarak mezun oldu. 1991 yılında aynı fakültede araştırma görevlisi olarak yüksek lisans çalışmalarına başladı. \r\n\r\nTürkiye’nin ilk Teknoparkı İ.T.Ü.-TEKMER’ de Türkiye’nin ilk  araştırma şirketi Altınay Robotik ve Otomasyon Limited Şirketi’ni kurdu. Altınay Robotik firması 1996 yılında Dünya Robot Federasyonu (IFR) tarafından Avrupa’nın 18 robot üreticisinden biri olarak kabul edildi. Altınay  geliştirdiği birçok yenilikçi ürün ve üretim teknolojilerine sahip  Türkiye ve Almanya’daki şirketlerinde, 600’ü mühendis ve doktoralı, 900’ü aşkın çalışanı ile ulusal ve uluslararası sanayinin hizmetine sunan  teknoloji şirketleri konumuna getirmiştir. \r\n\r\nAltınay Teknoloji Grubu şirketlerindeki yönetim kurulu başkan ve başkan yardımcılığı görevleriyle birlikte Altınay Savunma Teknolojileri A.Ş’de yönetim kurulu başkanlığı, Şirketin iştirakleri olan DASAL Havacılık Teknolojileri A.Ş. (%51 ALTINAY-%49 ASELSAN) Yönetim Kurulu Başkanı, TAAC Havacılık Teknolojileri A.Ş. ( %50 ALTINAY - %50 TUSAŞ ) Yönetim Kurulu Başkan Yardımcısı olarak görevleri devam etmektedir.', );

